import React, {useState, useEffect} from 'react';
import axios from "axios"

function App() {

  useEffect(()=> {
    axios.get("api.openweathermap.org/data/2.5/weather?q=London",{
      params: {
        key: "",
        part: "",
        q: "term",
        maxResults: ""
      }
    })
  },[])
  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
